static const uint32_t idM24[24] = {0x800000, 0x400000, 0x200000, 0x100000, 0x80000, 0x40000, 0x20000, 0x10000, 0x8000, 0x4000, 0x2000, 0x1000, 0x800, 0x400, 0x200, 0x100, 0x80, 0x40, 0x20, 0x10, 0x8, 0x4, 0x2, 0x1};

static const int ktb = 0x0;
static const int kte = 0xf;

u32 FROR48(u32 x, int r)
{
    return ((x >> r) | (x << (24 - r)) & MASK24) & MASK24;
}

u32 FROL48(u32 x, int r)
{
    return ((x << r) | (x >> (24 - r)) & MASK24) & MASK24;
}

void initialaffine()
{
    Aff64 A1_inv;
    genaffinepairM64(&A1, &A1_inv);
}

void sub_DCA48_KeyCheck(u32 *key_candidate, int key_candidate_count, int q, u32 *reduced_key, int *reduced_key_count)
{
    u32 x0, x1, y0, y1, z0, z1;
    int k, kkey, x, j, s, ts, l, b, bit, i;
    u32 state;
    
    WORD_TYPE p[2];
    WORD_TYPE c[2];

    int key_count = 0;

    u64 map[apt]; 
    int f = 0, g = 0; 
    FILE *fp = fopen("Result_SPECK48.txt", "a");
    printf("------Partial Key Verification-----\n");  
    fprintf(fp, "------Partial Key Verification-----\n"); 

    u32 key_guess[1000] = {0};
    int k_count = 0;
    double k_max = 0.0;
    int knum = 0;
    for(s = 0; s < key_candidate_count; s++) // key
    {
        k = key_candidate[s];
        for(x = 0; x < apt; x++) // adaptive inputs
        {
            x0 = (u32)(x) << ((q - 1) * 4);
            x1 = 0;
            
            y1 = FROR48(FROL48((x0 - x1) & MASK24, 8) ^ x1, 3);
            y0 = FROL48(((FROL48((x0 - x1) & MASK24, 8) ^ k) - y1) & MASK24, 8);
            
            p[0] = y0;
            p[1] = y1;
            map[x] = encrypt(p, c);
        }
        double k_score = 0.0;
        double L_score[apt] = {0.0};
        int L_count[apt] = {0};
        int l_count = 0;
        double l_max = 0.0;
        for(l = 1; l < apt; l++)
        {  
            double score = 0.0;
            double j_max = 0.0;
            int j_count = 0;
            for(j = 0; j < tb48; j++) // samples of traces
            {
                int Nf0 = 0, Nf1 = 0, Ng0 = 0, Ng1 = 0, N00 = 0, N01 = 0, N10 = 0, N11 = 0;
                for(x = 0; x < apt; x++)
                { 
                    if(j < 24)
                    {    
                        if((map[x] >> 32) & idM24[j]) ts = 1; // traces
                        else ts = 0;
                    }
                    else
                    {
                        if(map[x] & idM24[j - 24]) ts = 1; // traces
                        else ts = 0;
                    }
                    ////// correlation
                    f = ts;
                    if(f) Nf1++;
                    else Nf0++;
                    
                    g = xor[l & x];
                    if(g) Ng1++;
                    else Ng0++;
                    
                    if(f == 1 && g == 1) N11++;
                    else if(f == 0 & g == 0) N00++;
                    else if(f == 1 & g == 0) N10++;
                    else N01++;
                }
                if(Nf1 && Nf0 && Ng1 && Ng0) score = abs((N11 * N00 - N10 * N01)) * 1.0 / (sqrt(Nf1) * sqrt(Nf0) * sqrt(Ng1) * sqrt(Ng0));
                else score = 0.0;
                if(score > j_max)
                {
                    j_count = 0;
                    j_max = score;
                    j_count++;
                }
                else if(fabs(score - j_max) < EPS)
                {
                    j_count++;
                }
            }
            L_score[l] = j_max;
            L_count[l] = j_count;
            if(L_score[l] > l_max) l_max = L_score[l];
        }
        k_score = l_max;
        if(fabs(k_score - k_max) < EPS)
        {
            for(l = 1; l < apt; l++)
            {
                if(fabs(L_score[l] - l_max) < EPS) // each encoding: key guess
                {
                    l_count += L_count[l];
                }
            }
            if(l_count >= 42) // (l_count > k_count) //
            {
                if(l_count > k_count) k_count = l_count;
                //knum = 0;
                key_guess[knum] = k;
                knum++;
                // printf("key guess: %.2x, encoding count: %d, correlation: %f\n", k, l_count, k_score);
                // fp = fopen("Result_SPECK32.txt", "a");
                // fprintf(fp, "key guess: %.2x, encoding count: %d, correlation: %f\n", k, l_count, k_score);
                // fclose(fp);
            }
            /*
            else if(l_count == k_count)
            {
                key_guess[knum] = k;
                knum++;
                // printf("key guess: %.2x, encoding count: %d, correlation: %f\n", k, l_count, k_score);
                // fp = fopen("Result_SPECK32.txt", "a");
                // fprintf(fp, "key guess: %.2x, encoding count: %d, correlation: %f\n", k, l_count, k_score);
                // fclose(fp);
            }
            */
        }
        else if(k_score > k_max) 
        {
            k_max = k_score; 
            knum = 0;
            for(l = 1; l < apt; l++)
            {
                if(fabs(L_score[l] - l_max) < EPS) // each encoding: key guess
                {
                    l_count += L_count[l];
                }
            }
            k_count = l_count;
            key_guess[knum] = k;
            knum++;
        }
    }
    fprintf(fp, "------\n");
    printf("------\n");
    for(k = 0; k < knum; k++)
    {
        fprintf(fp, "Verified key: %.2x, encoding count: %d\n", key_guess[k], k_count);
        printf("Verified key: %.2x, encoding count: %d\n", key_guess[k], k_count);
        reduced_key[k] = key_guess[k];
        key_count++;
    }
    *reduced_key_count = key_count;
    fprintf(fp, "------\n");
    printf("------\n");

    fprintf(fp, "SE-SPECK48 Verified key count: %d\n", key_count);
    printf("SE-SPECK48 Verified key count: %d\n", key_count);
    fclose(fp); 
}
